import React from 'react';
import './Menu.css';

export default class Menu extends React.Component{
    render(){
        return(
            <div className="Menu">
                <Fab variant="extended" aria-label="Delete" className={classes.fab}>
                    <NavigationIcon className={classes.extendedIcon} />
                    Extended
                </Fab>
            </div>
        );
    }
}
